(46, 1, '2018-11-21 13:41:55', '2018-11-21 15:41:55', '<h2>Pensou em <strong>Importadora de peças Mercedes</strong>. Pense <strong>SUPORT PARTS</strong>!</h2>\r\nA <strong>SUPORT PARTS</strong> trabalha zelando sempre pela garantia de qualidade e a plena satisfação dos clientes. Além dos nossos preços acessíveis e atendimento personalizado feito por nossa equipe de profissionais devidamente habilitados em nossa <strong>Importadora de peças Mercedes</strong>.\r\n\r\nDistribuímos Peças Mercedes para todo Brasil via correio e/ou se necessário transportadora por indicação do cliente. Na região metropolitana de São Paulo contamos com o serviço terceirizado de motoboys para atender a <strong>Importadora de peças Mercedes</strong>.\r\n\r\nEstamos prontos para atender com total conhecimento e agilidade as necessidades dos clientes que buscam a melhor <strong>Importadora de peças Mercedes</strong> do mercado. Abastecendo o mercado com peças garantidas e com preços abaixo do mercado. Desta forma, nossos clientes podem contar com nossa ampla variedade de peças Mercedes.\r\n<h2>Comercializamos peças junto a <strong>Importadora de peças Mercedes</strong> desde:</h2>\r\n<ul class=\"topicos\">\r\n 	<li>Motor;</li>\r\n 	<li>Câmbio;</li>\r\n 	<li>Elétrica;</li>\r\n 	<li>Suspensão;</li>\r\n 	<li>Freios;</li>\r\n 	<li>Acessórios; entre outros.</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Sobre a Troca e Garantia na <strong>Importadora de peças Mercedes</strong>:</h2>\r\nA <strong>SUPORT PARTS</strong> cumpre rigorosamente as ordens do Código de defesa ao consumidor. Nossos clientes têm o direito de trocar as Peças Mercedes e demais marcas por compras erradas em até 07 dias úteis a contar do dia de recebimento da mesma, fazendo a devolução dela em perfeitas condições, dentro de sua respectiva embalagem não violada. Já no caso de defeitos do produto, as peças Mercedes serão trocadas sem burocracia de acordo com o prazo de garantia do mesmo.\r\n\r\nNa <strong>Importadora de peças Mercedes</strong> tod