(74, 1, '2018-11-21 14:01:56', '2018-11-21 16:01:56', '<h2>Empresa especializada na distribuição de <strong>Peças Kia</strong> no Brasil é na <strong>SUPORT PARTS</strong>!</h2>\r\nAtuando no mercado há anos, a <strong>SUPORT PARTS</strong> fornece produtos aos clientes com total segurança e conhecimento. Contamos com profissionais devidamente preparados a prestar um atendimento exclusivo e eficaz, capaz de identificar as reais necessidades de cada cliente que busca por <strong>Peças Kia</strong>. Sempre com mercadorias de qualidade, preços diferenciados e atendimento personalizado.\r\n\r\nAtravés da nossa grande experiência de mercado, temos como fornecer uma grande variedade de <strong>Peças Kia</strong>, na qual os clientes podem contar com a comodidade de realizar seus pedidos através do nosso site.\r\n\r\nDistribuímos <strong>Peças Kia</strong> para todo Brasil via correio e/ou se necessário transportadora por indicação do cliente. Na região metropolitana de São Paulo contamos com o serviço terceirizado de motoboys.\r\n<h2>Na SUPOR PARTS você encontrará diversas <strong>Peças Kia</strong> para atender desde:</h2>\r\n<ul class=\"topicos\">\r\n 	<li>Oficinas;</li>\r\n 	<li>Montadoras de veículos;</li>\r\n 	<li>Concessionárias;</li>\r\n 	<li>Consumidor final; entre outros.</li>\r\n</ul>\r\n<h2>Entre as <strong>Peças Kia</strong> fornecemos:</h2>\r\nFornecemos desde motores, suspensão, freios, vidros, lanternas, faróis, lâmpadas, frizos, disco de freio, pastilhas, filtros de ar, óleo, de combustível, etc.\r\n<h2>Compromisso <strong>SUPORT PARTS</strong> - <strong>Peças Kia</strong>:</h2>\r\nA <strong>SUPORT PARTS</strong> tem como compromisso oferecer aos parceiros, colaboradores e clientes, um atendimento com a máxima agilidade e qualidade nos serviços. Além de oferecer os melhores preços de <strong>Peças Kia</strong> do mercado.\r\n\r\nPara maiores informações é só entrar em contato conosco, no caso de orçamento das <strong>Peças Kia</strong> é necessário ter o número de chassis do veículo. Para retirada de peças no local é necessário um e-mail de confirmação do pedido com 48h de antecedência.\r\n<h2>Escritório e Vendas da <strong>SUPORT PARTS</strong> - <strong>Peças Kia</strong>:</h2>\r\nRua Mário Zampieri, 45 - Centro - São Bernardo do Campo - SP. O expediente da empresa é das 08h00min às 17h30min.\r\n\r\nConte com a <strong>SUPORT PARTS</strong>. Aqui você encontra o que há de melhor em <strong>Peças Kia</strong>!', 'Peças Kia', '', 'inherit', 'closed', 'closed', '', '72-revision-v1', '', '', '2018-11-21 14:01:56', '2018-11-21 16:01:56', '', 72, 'http://suportparts.temporario.agenciasense.com.br/72-revision-v1/', 0, 'revision', '', 0),
