(78, 1, '2018-11-21 14:06:23', '2018-11-21 16:06:23', '<h2>Pensou em <strong>Peças Mercedes</strong>. Pense <strong>SUPORT PARTS</strong>!</h2>\r\nA <strong>SUPORT PARTS</strong> trabalha com <strong>Peças Mercedes</strong> zelando sempre pela garantia e a satisfação dos clientes. Além dos nossos preços acessíveis e atendimento personalizado feito por nossa equipe de profissionais devidamente habilitados a atender nossos clientes com responsabilidade e dedicação.\r\n\r\nNossas <strong>Peças Mercedes</strong> passam por constante aperfeiçoamento a fim de aprimorar seus processos de fabricação e garantir total tranqüilidade aos seus clientes que buscam um diferencial de mercado.\r\n\r\nDistribuímos <strong>Peças Mercedes</strong> para todo Brasil via correio e/ou se necessário transportadora por indicação do cliente. Na região metropolitana de São Paulo contamos com o serviço terceirizado de motoboys.\r\n<h2>Além das <strong>Peças Mercedes</strong>, fornecemos:</h2>\r\n<ul class=\"topicos\">\r\n 	<li>Peças para Audi;</li>\r\n 	<li>Peças para BMW;</li>\r\n 	<li>Peças para Jaguar;</li>\r\n 	<li>Peças para Land Rover;</li>\r\n 	<li>Peças para Volvo;</li>\r\n 	<li>Peças Mitsubishi;</li>\r\n 	<li>Peças para Mini Cooper;</li>\r\n 	<li>Peças para Porsche;</li>\r\n 	<li>Peças para Smart.</li>\r\n</ul>\r\n<h2>Sobre a Troca e Garantia das <strong>Peças Mercedes</strong>:</h2>\r\nA <strong>SUPORT PARTS</strong> cumpre rigorosamente as ordens do Código de defesa ao consumidor. Nossos clientes têm o direito de trocar as <strong>Peças Mercedes</strong> e demais marcas por compras erradas em até 07 dias úteis a contar do dia de recebimento da mesma, fazendo a devolução dela em perfeitas condições, dentro de sua respectiva embalagem não violada. Já no caso de defeitos do produto, as <strong>Peças Mercedes</strong> serão trocadas sem burocracia de acordo com o prazo de garantia do mesmo.\r\n\r\nPara orçamento das <strong>Peças Mercedes</strong> é necessário ter o número de chassis do 